import React from 'react';
import './index.css';

const styles = {
    height: '80vh',
    weight: '1000px !important'
}

class Frameworks extends React.Component {
    render() {
        return (
            <div id={this.props.id} className="section-dark frameworks" style={styles}>
                <h1>Frameworks:</h1>
            </div>
        );
    };
};

export default Frameworks;
